  { text: "Walk the dog", complete: true },
  { text: "Write app", complete: false }
];

const App: React.FC = () => {
  return (
    <>
      <Profile todo={todos[0]}/>
      <Profile todo={todos[1]}/>
    </>
  );
}

export default App;
